import Cards from './Components/Cards/Cards';
import Carousel from './Components/Carousel/Carousel';
import Categories from './Components/Categories/Categories';
import Navbar from './Components/Navbar/Navbar';

function App() {
  return (
    <div className="App">
        <Navbar />
        <Categories />
        {/* <Carousel /> */}
        <Cards />
    </div>
  );
}

export default App;
